script: |
  super -f text -I q13088.spq | sort > q13088.out

inputs:
  - name: q13088.spq
    data: |
      SELECT ALL + 88 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 BETWEEN - col0 AND - col2 / - col2 - + 91;
  - name: tab2

outputs:
  - name: q13088.out
    data: |
      88
      88
      88
